import {React, useState, useEffect} from 'react';
import './MainContent.css';
import img1 from './images/img1.jpg';
import img2 from './images/img2.jpg';
import img3 from './images/img3.png';

const MainContent = () => {

  const[tootTipImage1, settoolTipImage1] = useState();
  const[tootTipImage2, settoolTipImage2] = useState();
  const[tootTipImage3, settoolTipImage3] = useState();

  useEffect(() => {
    fetchToolKitImage1();
    fetchToolKitImage2();
    fetchToolKitImage3();
},[]
)

const fetchToolKitImage1 = async () => {
    try{
        const resData = await fetch('http://localhost:5000/api/toolkit/image1');
        const message = await resData.json();
        settoolTipImage1(message.data);
    }
    catch(error){
        console.log('Can not load message', error);
    }
}

const fetchToolKitImage2 = async () => {
  try{
      const resData = await fetch('http://localhost:5000/api/toolkit/image2');
      const message = await resData.json();
      settoolTipImage2(message.data);
  }
  catch(error){
      console.log('Can not load message', error);
  }
}

const fetchToolKitImage3 = async () => {
  try{
      const resData = await fetch('http://localhost:5000/api/toolkit/image3');
      const message = await resData.json();
      settoolTipImage3(message.data);
  }
  catch(error){
      console.log('Can not load message', error);
  }
}

  return (
    <div className="main-content">
      <h2>Main Content</h2>
      <p>
        This is the main content of the page. You can add any text, images, or other elements here.
        For this example, let's add a list of features:
      </p>
      <ul>
        <li>Feature 1: Lorem ipsum dolor sit amet.</li>
        <li>Feature 2: Consectetur adipiscing elit.</li>
        <li>Feature 3: Integer molestie sapien a justo ullamcorper.</li>
        <li>Feature 4: Sed sit amet lectus vel diam aliquam eleifend.</li>
      </ul>
      <div className='img-container'>
        <img src = {img1} alt = "img1"/>
        <div class = "middle">
          <div class="text"> Doe</div>
        </div>
        <img src = {img2} alt = "img2"/>
        <img src = {img3} alt = "img3"/>
      </div>
    </div>
  );
};

export default MainContent;
